import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [tags, setTags] = useState([]);
  const [paginationLinks, setPaginationLinks] = useState({});

  useEffect(() => {
    fetchTags();
  }, []);

  const fetchTags = async (
    url = "https://api.stb.gov.sg/content/common/v2/tags"
  ) => {
    try {
      const headers = {
        Accept: "application/json",
        "X-Api-Key": "nE2LLxGGycJ7Egvtg2xXJZOpXNOVbKFW",
      };

      const tagsResponse = await axios.get(url, { headers });
      setTags(tagsResponse.data.data || []);
      setPaginationLinks(tagsResponse.data.paginationLinks || {});
    } catch (error) {
      console.error("Error fetching tags:", error);
    }
  };

  const fetchNextPage = () => {
    if (paginationLinks.next) {
      console.log("Fetching next page:", paginationLinks.next);
      fetchTags(paginationLinks.next);
    }
  };

  const fetchPreviousPage = () => {
    if (paginationLinks.prev) {
      fetchTags(paginationLinks.prev);
    }
  };

  return (
    <div>
      <h1>Tags</h1>
      <ul>
        {tags.map((tag, index) => (
          <li key={index}>{tag.name}</li>
        ))}
      </ul>
      <button onClick={fetchPreviousPage} disabled={!paginationLinks.prev}>
        Previous
      </button>
      <button onClick={fetchNextPage} disabled={!paginationLinks.next}>
        Next
      </button>
    </div>
  );
}

export default App;
